import React from "react";
import styled from "styled-components";
import { UserIcon, BellIcon } from "./assets/Icons";
import UserSvg from '../layout/assets/user.svg'

const TopBar = styled.div`
  width: 100%;
  height: 64px;
  margin-bottom 0.1rem;
  padding: 20px 24px 20px 17px;
  box-shadow: 0 1px 4px 0 rgba(0, 21, 41, 0.12);
  background-color: #ffffff;
  display: flex;
  justify-content: flex-end;
`;

const Item = styled.div`
//   padding: 0 0.5rem;
  padding: ${({ type }) => (type==='merchant' ? "3px 0.5rem 0 0.5rem" : "0 0.5rem")};
  `;

const Topbar = () => {
  return (
    <TopBar>
      <Item>
        <BellIcon />
      </Item>
      <Item type={'merchant'}>Merchant name</Item>
      <Item>
        <UserIcon src={UserSvg}/>
      </Item>
    </TopBar>
  );
};

export default Topbar;
